import React from 'react';
import { Handle, NodeProps, Position } from 'reactflow';
import defaultNodes from './DnDFlowPro'

const handleStyle = { opacity: 0 };
export default () => {
  const onDragStart = (event, nodeType,label) => {
    event.dataTransfer.setData('application/reactflow', nodeType);
    event.dataTransfer.effectAllowed = 'move';
  };
  console.log
  return (
    <aside>
      <div className="description">You can drag these nodes to the pane on the right.</div>
      <div className="dndnode  " onDragStart={(event) => onDragStart(event, 'input')} draggable>
        Input Node
      </div>
      <div className="dndnode " onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 1
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 2
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 3
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 4
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 6
      </div>
      <div className="dndnode output" onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 7
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 8
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, 'default')} draggable>
        Node 9
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, 'Output')} draggable>
        Node 10
      </div>
      

    </aside>
  );
};
